package scalecodec_test

import (
	"fmt"
	"io/ioutil"
	"testing"

	scalecodec "github.com/itering/scale.go"
	"github.com/itering/scale.go/source"
	"github.com/itering/scale.go/types"
	"github.com/itering/scale.go/utiles"
)

const (
	Kusama1055 = ""
	Crab2      = ""
	Edg        = ""
	Plasm      = ""

	metadataV12 = ""

	metadataV13 = ""
	v14         = ""
)

func TestMetadataV11DecoderProcess(t *testing.T) {
	m := scalecodec.MetadataDecoder{}
	m.Init(utiles.HexToBytes(Kusama1055))
	if m.Process() != nil {
		t.Errorf("Test MetadataDecoder Process fail")
	}
	if m.Version != "MetadataV11Decoder" {
		t.Errorf("MetadataV11 version should equal 11")
	}
}

